    return(
        <>
            <table border={1} cellPadding={7} cellSpacing={3}>
                <tr>
                    <th>NO</th>
                    <th>NAME</th>
                    <th>AGE</th>
                </tr>
                {
                    arr.map((e,index)=>
                    {
                        return(
                            <>
                                <tr>{e.index + 1}</tr>
                                <tr>{e.name}</tr>
                                <tr>{e.age}</tr>
                            </>
                        )
                    })
                }
            </table>
        </>
    );
}

export default Maping;
